import React from 'react';
import { Link, BrowserRouter } from 'react-router-dom';

function Navbar() {
  return (
    <BrowserRouter>
      <div className="navbar">
        <a className="brand-name">Professionality</a>
        <nav class="navbar">
        <div class="navbar-left">
          <a href="#" class="navbar-brand">Brand Name</a>
        </div>
        <div class="navbar-right">
          <button class="navbar-button">Button 1</button>
          <button class="navbar-button">Button 2</button>
          <button class="navbar-button">Button 3</button>
        </div>
      </nav>

      </div>
    </BrowserRouter>
  );
}

export default Navbar;
